import React, { Component } from 'react';

export default class PaymentMethods extends Component {
  constructor(props) {
    super(props);
    this.state = {
      paymentMethods: [],
    };
  }

  componentDidMount() {
    // Fetching data from the API
    fetch('https://api.adkey-seo.com/api/website/get-payments/295')
      .then(response => response.json())
      .then(data => {
        this.setState({ paymentMethods: data });
      })
      .catch(error => console.error('Error fetching payment methods:', error));
  }

  render() {
    return (
      <section className='payment-methods'>
        <div className="container">
          <h2 className="title">
            Payment Methods
          </h2>
          <div className="inner">
            {this.state.paymentMethods.map(method => (
              <div key={method.payment_id} className="payment-method">
                <img src={`https://api.adkey-seo.com/${method.image}`} alt={method.name} />
                <div>
                  <h3>{method.name}</h3>
                  <p><strong>Type:</strong> {method.type}</p>
                  <p><strong>Country:</strong> {method.country}</p>
                  <p><strong>Commission:</strong> {method.commission}</p>
                  <p><strong>Processing Time:</strong> {method.processing_time}</p>
                  <p><strong>Minimum Deposit:</strong> {method.min_dep}</p>
                </div>
              </div>
            ))}
          </div>
        </div>
      </section>
    );
  }
}
